import instaIcom from '../assets/images/icon-instagram.svg';
import youtubeIcom from '../assets/images/icon-youtube.svg';
const Card = () => {
    return (
        <div className="card">
            <div className="title">
                <p>  <img src={FacebookIcon} alt="facebook" /> @nathanf</p>
            </div>
            <div className="number">
